import './header.css';
import './footer.css';
import './styles.css';

export default function App() {
  return (
    <div className="App flex flex-col">
      <Navbar />
      <Welcome />
      <Footer />
    </div>
  );
}

function Navbar() {
  return (
    <header className="flex-inline md:flex md:flex-row">

    </header>
  );
}

function Welcome() {
  return (
    <main>

      <div>wwwwwelcome!</div>
      <div>Carousel</div>
    </main>
  );
}

function Footer() {
  return (
    <footer className='bottom-0 text-white p-2'>Tous droits réservés PetMeeting 2024</footer>
  );
}
